import { useEffect, useState } from "react";

const Textview = ({ text }) => {
  return <div>{text}</div>;
};

const OptimizeTest = () => {
  const [count, setCount] = useState(1);
  const [text, setText] = useState(1);

  return (
    <div style={{ padding: 50 }}>
      <div>
        <h2>count</h2>
        <button
          onClick={() => {
            setCount(count + 1);
          }}
        >
          +
        </button>
      </div>

      <div>
        <h2>text</h2>
        <input value={text} onChange={(e) => setText(e.tartget.value)} />
      </div>
    </div>
  );
};

export default OptimizeTest;
